<!doctype html>
<html>
<head>
<meta charset="utf-8">
<title>datejs</title>
<script src="../date.min.js"></script>
</head>

<body>
<script>
(function(){

  var date = new Date();
  var html = '<ul><li>' + 
  Object.keys(date.__proto__).map(function(key){
    return 'date.' + key
  }).join('</li><li>') + 
  '</li></ul>'

  document.write(html);

})();
</script>
</body>
</html>
